import './Card.css';
import DeepTable from './DeepTable';

const Table = ({ team, index }) => {

  return (
    <section className='table-heaader'>
          <div>Pos</div>
          <div>Club</div>
          <div>PG</div>
          <div>W</div>
          <div>D</div>
          <div>D</div>
          <div>GF</div>
          <div>GA</div>
          <div>GD</div>
          <div>P</div>
        {team.table.map((e, key) => <DeepTable e={e} key={key}/>)}
    </section>
  )
};

export default Table;
